import React, { Component } from 'react';
/* CSS */
import '../public/navbar/style.css';
class index extends Component {
    curriculo() {
  
        window.open("https://drive.google.com/open?id=1uJBSaCONVA-P0TsRnWk9ufdgYSQnuA00", "_blank")
     }
     contato() {
         window.location.href = "#footer";
     }
     
    render() {
        return (
            <div>
                <section className="navbar">
                    <div className="container">
                        <div className="menu">
                            <img alt="logo arthur bl" className="logo" src="/Assets/logo.png" />
                        </div>
                        <img alt="imagem de fundo" className="p1-fundo" src="/Assets/p1-fundo.png" />
                    </div>



                </section>
            </div>
        );
    }
}

export default index;
